import * as React from 'react';
import AspectRatio from '@mui/joy/AspectRatio';
import Button from '@mui/joy/Button';
import Card from '@mui/joy/Card';
import CardContent from '@mui/joy/CardContent';
import IconButton from '@mui/joy/IconButton';
import Typography from '@mui/joy/Typography';
import BookmarkAdd from '@mui/icons-material/BookmarkAddOutlined';

export default function BasicCard() {
  const cardData = [
    { 
      title: 'Yosemite National Park',
      imageSrc: 'https://images.unsplash.com/photo-1527549993586-dff825b37782?auto=format&fit=crop&w=286',
      imageSrcSet: 'https://images.unsplash.com/photo-1527549993586-dff825b37782?auto=format&fit=crop&w=286&dpr=2 2x',
      price: '$3.900'
    },

  ];

  return (
    <>
      {cardData.map((card, index) => (
        <Card key={index} sx={{ width: 320 }}>
          <div>
            <Typography level="title-lg">{card.title}</Typography>

            <IconButton
              aria-label={`bookmark ${card.title}`}
              variant="plain"
              color="neutral"
              size="sm"
              sx={{ position: 'absolute', top: '0.875rem', right: '0.5rem' }}
            >
              <BookmarkAdd />
            </IconButton>
          </div>
          <AspectRatio minHeight="320px" maxHeight="200px">
            <img
              src={card.imageSrc}
              srcSet={card.imageSrcSet}
              loading="lazy"
              alt=""
            />
          </AspectRatio>
          <CardContent orientation="horizontal">
            <div>
              <Typography level="body-xs">Цена:</Typography>
              <Typography fontSize="lg" fontWeight="lg">
                {card.price}
              </Typography>
            </div>
            <Button
              variant="solid"
              size="md"
              color="primary"
              aria-label={`Explore ${card.title}`}
              sx={{ ml: 'auto', alignSelf: 'center', fontWeight: 600 }}
            >
              В корзину
            </Button>
          </CardContent>
        </Card>
      ))}
    </>
  );
}
